{'name': 'RapidAPI', 'api_name': 'requests.get', 'description': 'PurgoMalum is a simple, free, RESTful web service for filtering and removing content of profanity, obscenity and other unwanted text. PurgoMalum\'s interface accepts several parameters for customization and can return results in plain text, XML and JSON.\r\n\r\nPurgoMalum is designed to remove words from input text, based on an internal profanity list (you may optionally add your own words to the profanity list through a request parameter (see Request Parameters below). It is designed to recognize character alternates often used in place of standard alphabetic characters, e.g. "@" will be recognized as an "a", "$" will be recognized as an "s", and so forth.\r\n\r\nPurgoMalum also utilizes a list of "safe words", i.e. innocuous words which contain words from the profanity list ("class" for example). These safe words are excluded from the filter.', 'parameters': [{'name': 'text', 'description': 'Input text to be processed.', 'type': 'STRING'}, {'name': 'add', 'description': 'A comma separated list of words to be added to the profanity list. Accepts letters, numbers, underscores (_) and commas (,). Accepts up to 10 words (or 200 maximum characters in length). The PurgoMalum filter is case-insensitive, so the case of you entry is not important.', 'type': 'STRING'}, {'name': 'fill_text', 'description': 'Text used to replace any words matching the profanity list. Accepts letters, numbers, underscores (_) tildes (~), exclamation points (!), dashes/hyphens (-), equal signs (=), pipes (|), single quotes (\'), double quotes ("), asterisks (*), open and closed curly brackets ({ }), square brackets ([ ]) and parentheses (). Maximum length of 20 characters. When not used, the default is an asterisk (*) fill.', 'type': 'STRING'}, {'name': 'fill_char', 'description': 'Single character used to replace any words matching the profanity list. Fills designated character to length of word replaced. Accepts underscore (_) t